import React, { useState, useCallback, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { Switch, Route, Redirect } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <>
      <Switch>
        <Route path="/auth">
          <AuthPage />
        </Route>
        )}
      </Switch>
      {/* user input certain invalid one */}
      <Route path="*">
        <Redirect to="/" />
      </Route>
    </>
  );
}

export default App;
